import React from 'react';
import { ProductDetails, Title, Description, Price, Location, DeliveryTime, Label, Text } from './styled';
const Component = ({ title, description, price, location, deliveryTime }) => {
    return (
        <ProductDetails>
            <Title>{title}</Title>
            <Description>
                <Label>Descripción</Label>
                <Text>{description}</Text>
            </Description>
            <Price>
                <Label>Precio de renta</Label>
                <Text>${price}</Text>
            </Price>
            <Location>
                <Label>Ubicación</Label>
                <Text>{location}</Text>
            </Location>
            <DeliveryTime>
                <Label>Tiepo de entrega</Label>
                <Text>{deliveryTime}</Text>
            </DeliveryTime>
        </ProductDetails>
    );
}

export default Component;
export { Component as ProductDetails }
